message:
‼️WATN - Mehr als 3 Millionen Menschen gingen in der argentinischen Hauptstadt Buenos Aires auf die Straße, um die Durchfahrt eines Busses mit Spielern der argentinischen Fußballweltmeistermannschaft in Katar zu erwarten.

"Mehr als 3 Millionen Fans haben die Stadt lahm gelegt, und die Route des Busses mit der Nationalmannschaft ist immer noch ungewiss", heißt es in einem Bericht des Fernsehsenders TN.

